import{_ as a,o as t,c as e,Q as o}from"./chunks/framework.e4a1f2a7.js";const n="/assets/windows-form.cec6c6de.png",r="/assets/project-pertama.e9b6cf94.png",_=JSON.parse('{"title":"Membuat Project","description":"","frontmatter":{},"headers":[],"relativePath":"create-project.md","filePath":"create-project.md","lastUpdated":1699410718000}'),i={name:"create-project.md"},s=o('<h1 id="membuat-project" tabindex="-1">Membuat Project <a class="header-anchor" href="#membuat-project" aria-label="Permalink to &quot;Membuat Project&quot;">​</a></h1><p>Halaman ini akan membahas cara membuat project baru pada Visual Studio. Project yang akan dibuat berbasis GUI (Graphical User Interface) dengan menggunakan Windows Forms.</p><h2 id="membuat-project-baru" tabindex="-1">Membuat Project Baru <a class="header-anchor" href="#membuat-project-baru" aria-label="Permalink to &quot;Membuat Project Baru&quot;">​</a></h2><ol><li>Buka Visual Studio.</li><li>Pilih menu <strong>File</strong> &gt; <strong>New</strong> &gt; <strong>Project</strong>.</li></ol><div style="text-align:center;"><img src="'+n+'" alt="new project" style="zoom:50%;"></div><p>Pada bagian bawah terdapat 3 form yaitu name, location dan solution name. Name adalah nama project yang akan dibuat, location adalah lokasi penyimpanan project dan solution name adalah nama solusi yang akan dibuat. Untuk lokasi penyimpanan project, dapat diubah dengan mengklik tombol <strong>Browse</strong>.</p><ol start="3"><li>Klik tombol <strong>Ok</strong> untuk membuat project baru. Berikut adalah tampilan project baru yang telah dibuat.</li></ol><div style="text-align:center;"><img src="'+r+'" alt="new project" style="zoom:50%;"></div><p>Di menu <strong>Solution Explorer</strong>, terdapat 2 file yaitu <strong>Form1.cs</strong> dan <strong>Program.cs</strong>. <strong>Form1.cs</strong> adalah file yang berisi kode untuk membuat tampilan GUI. <strong>Program.cs</strong> adalah file yang berisi kode untuk menjalankan program. Pada bagian sisi kirinya, terdapat toolbox yang berisi komponen-komponen yang dapat digunakan untuk membuat tampilan GUI. Pada bagian sisi kanan, terdapat properties yang berisi properti dari komponen yang dipilih.</p>',9),l=[s];function m(c,p,d,u,g,b){return t(),e("div",null,l)}const h=a(i,[["render",m]]);export{_ as __pageData,h as default};
